(4, 'Марк Мина', '253369169', '20706/enc-9e93786c43d204864d1bc301e5e0f493ae9c9c7dd2485a6aaffb8ef487e9f963', '2022-07-06 19:18:13', 'Привет. Это первый комментарий. Если у Вас появились вопросы - смело задавайте их через форму ниже.'),
(5, 'mihmina', '799455833', '0/0-0', '2022-07-14 18:30:56', 'Добрый день, будет ли возможность расчета северного стажа?'),
(6, 'ira.guseva.1', '871581135', '39249/us9r8GLXrbCsaVatP8WjIKK0EGM-1', '2022-07-24 18:22:28', 'в расчете стажа Пенсионным фондом потеряно 1 мес. 11 дней. Как восстановить эти дни?'),
(7, 'Татьяна Устинова', '661000278', '43473/enc-0cae8c84b7b05b07bf9a00ba612679e02782d51ba5671298afac8156d9597005', '2022-08-04 22:25:00', 'У меня неудачный вариант расчёта. '),
(8, 'Марк Мина', '253369169', '20706/enc-9e93786c43d204864d1bc301e5e0f493ae9c9c7dd2485a6aaffb8ef487e9f963', '2022-08-08 14:30:31', 'Спасибо, что оставили комментарий. Мы тестируем смену переменных в расчете. Уже почти все готово. Через 2 - 3 дня можно будет скачивать расчет с изменяемыми показателями. Если потребуется емейл дл я связи - m6132@yandex.ru'),
(9, 'Марк Мина', '253369169', '20706/enc-9e93786c43d204864d1bc301e5e0f493ae9c9c7dd2485a6aaffb8ef487e9f963', '2022-08-08 22:37:16', 'По состоянию на 08.08.2022 расчет уже можно скачивать в надлежащем виде. Акция по 2 рубля за расчет продлится до 31.08.2022. До этого времени будет продолжаться отладка расчета и ux сайта. Спасибо');
